/// data : {"result_b64":"","foreground_top":67,"foreground_left":89,"foreground_width":77,"foreground_height":67}

class NoBackgroundResponse {
  NoBackgroundResponse({
      this.data,});

  NoBackgroundResponse.fromJson(dynamic json) {
    data = json['data'] != null ? Data.fromJson(json['data']) : null;
  }
  Data? data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (data != null) {
      map['data'] = data?.toJson();
    }
    return map;
  }

}

/// result_b64 : ""
/// foreground_top : 67
/// foreground_left : 89
/// foreground_width : 77
/// foreground_height : 67

class Data {
  Data({
      this.resultB64, 
      this.foregroundTop, 
      this.foregroundLeft, 
      this.foregroundWidth, 
      this.foregroundHeight,});

  Data.fromJson(dynamic json) {
    resultB64 = json['result_b64'];
    foregroundTop = json['foreground_top'];
    foregroundLeft = json['foreground_left'];
    foregroundWidth = json['foreground_width'];
    foregroundHeight = json['foreground_height'];
  }
  String? resultB64;
  int? foregroundTop;
  int? foregroundLeft;
  int? foregroundWidth;
  int? foregroundHeight;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['result_b64'] = resultB64;
    map['foreground_top'] = foregroundTop;
    map['foreground_left'] = foregroundLeft;
    map['foreground_width'] = foregroundWidth;
    map['foreground_height'] = foregroundHeight;
    return map;
  }

}